import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './css/Dashboard.css'

function CarDashboard() {
  const [cars, setCars] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const response = await axios.get('/api/cars');
      setCars(response.data);
    }
    fetchData();
  }, []);

  return (
    <div>
      <h1>Car Dashboard</h1>
      <table className="car-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Brand</th>
            <th>Model</th>
            <th>Year</th>
            <th>Price</th>
            <th>Gearbox</th>
            <th>Fuel</th>
            <th>Image</th>
            <th>Available</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {cars.map(car => (
            <tr key={car.id}>
              <td>{car.id}</td>
              <td>{car.brand}</td>
              <td>{car.model}</td>
              <td>{car.year}</td>
              <td>{car.price}</td>
              <td>{car.gearbox}</td>
              <td>{car.fuel}</td>
              <td>{car.image}</td>
              <td>{car.available ? 'Yes' : 'No'}</td>
              <td>
                <button className="edit-button" onClick={() => console.log('Edit car', car)}>Edit</button>
                <button className="delete-button" onClick={() => console.log('Delete car', car)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default CarDashboard;
